	override val skipWhitespace = false

	private val comment: Parser[Token] = ("""//.*|(?m)/\*(\*(?!/)|[^*])*\*/""".r) ^^ (TokenComment(_))
	private val identifier: Parser[Token] = ident ^^ (TokenIdent(_))
	private val nl : Parser[Token] = """\n\r?|\r\n?""".r ^^ (s => TokenNl())
	private val tab : Parser[Token] = """\t""".r ^^ (s => TokenTab())
