	    """([0-9]+|(['].['])|('.{4}')|((\$[0-9a-fA-F]+)|(0[xX][0-9a-fA-F]+))|(0[0-7]*))""".r  ^^ (TokenInt(_))
	private val float : Parser[Token] = (
	    """(([0-9]*)\.([0-9]+))|(([0-9]+)\.([0-9]*))""".r) ^^ (TokenFloat(_))
	private val string : Parser[Token] = """"([^"\\]|\\.)*"""".r ^^ (TokenString(_))
	
	// other tokens, should not contain symbols which could start an other token
	private val other : Parser[Token] = """[^a-zA-Z\t\n\r0-9"'.]+""".r ^^ (TokenOther(_))
	private val invalid : Parser[Token] = """.""".r ^^ (TokenOther(_))
	    
	private val file : Parser[List[Token]] = rep(comment|float|int|string|identifier|nl|tab|other|invalid)

